import PropTypes from 'prop-types';
import Button from '../../../shared/Button/Button';
import Input from '../../../shared/Input/Input';
import FormItem from '../../../shared/Form/FormItem/FormItem';

const Telegram = props => {
    return (
        <div className='h-full flex flex-col'>
            <h1 className='text-2xl text-gray-800 font-medium pb-6 mb-10 border-b border-gray-300'>Telegram</h1>
            <div className='max-w-3xl pr-10 xl:pr-16'>
                <div>
                    <h2 className='mb-7 text-2xl font-medium text-gray-800'>Copy Telegram ID</h2>
                    <p className='text-gray-700 text-xl mb-5'>Copy your Telegram ID after starting the bot</p>

                    <div className='flex justify-center'>
                        <Button type={'link'} className={'mr-10'}>
                            Previous
                        </Button>
                        <Button type={'link'}>Next</Button>
                    </div>
                </div>

                <div>
                    <h2 className='mb-7 text-2xl font-medium text-gray-800'>Enter Telegram ID</h2>
                    <p className='text-gray-700 text-xl mb-5'>Please enter your Telegram ID below</p>
                    <FormItem helpMessage label={'Telegram ID'} className={'mb-8'}>
                        <Input type={'text'} />
                    </FormItem>

                    <div className='flex justify-center'>
                        <Button type={'link'} className={'mr-10'}>
                            Previous
                        </Button>
                        <Button type={'link'}>Connect</Button>
                    </div>
                </div>
            </div>
        </div>
    );
};

Telegram.propTypes = {};

export default Telegram;
